import React, { Component } from 'react'

export default class App extends Component {
  overr(){
    let colorr={
      color:"#000"
    }
  }
  render() {
    let colorr = {
      color:"#ff0000"
    }
    return (
      <div>
        <h1 style={colorr} onMouseOver={this.overr}>hello world</h1>
      </div>
    )
  }
}
